import { FaTimes } from 'react-icons/fa'

const Task = ({ task, onDelete }) => {
  return (
    <div className="task">
        <h2>
            {task.text} <FaTimes style={{ color: "red", cursor: "pointer"}} onClick={onDelete}/>
        </h2>
        <p>{task.day}</p>
    </div>
  )
}

export default Task
